import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import landingpage from "./landingpage";
import contact from "./contact";
import aboutme from "./aboutme";
import project from "./project";
import resume from "./resume";

const Main = () => (
  <Router>
    <Switch>
      <Route location={"/contact"} exact path="/" component={landingpage} />
      <Route location={"/contact"} exact path="/contact" component={contact} />
      <Route location={"/contact"} exact path="/aboutme" component={aboutme} />
      <Route location={"/contact"} path="/project" component={project} />
      <Route location={"/resume"} path="/resume" component={resume} />
    </Switch>
  </Router>
);

export default Main;
